#!/usr/bin/env python3

# Read input
points = []
for _ in range(3):
    points.append([int(x) for x in input().split()])

# Get the fourth point.
for i in range(3):
    for j in range(i+1, 3):
        if points[i][0] == points[j][0] and points[i][1] != points[j][1]:
            # Two points have the same x coordinate, but different y coordinates.
            # The fourth point must have the same x coordinate as the other two, but the same y coordinate as the other point.
            print(points[i][0], points[3-i-j][1], sep=' ')
            break
        elif points[i][1] == points[j][1] and points[i][0] != points[j][0]:
            # Two points have the same y coordinate, but different x coordinates.
            # The fourth point must have the same y coordinate as the other two, but the same x coordinate as the other point.
            print(points[3-i-j][0], points[i][1], sep=' ')
            break
        elif i == 2 and j == 3:
            # If we haven't found the fourth point, that means the points are not collinear.
            # The fourth point must have the same x coordinate as one point, and the same y coordinate as the other point.
            print(points[0][0], points[2][1], sep=' ')


def main():
    x1, y1 = map(int, input().split()) # 1つ目の点の座標
    x2, y2 = map(int, input().split()) # 2つ目の点の座標
    x3, y3 = map(int, input().split()) # 3つ目の点の座標
    x4 = 0
    y4 = 0
    if x1 == x2: # 1つ目と2つ目の点がx座標が同じ場合
        x4 = x3
    elif x2 == x3: # 2つ目と3つ目の点がx座標が同じ場合
        x4 = x1
    else: # それ以外の場合
        x4 = x2
    if y1 == y2: # 1つ目と2つ目の点がy座標が同じ場合
        y4 = y3
    elif y2 == y3:
        y4 = y1
    else:
        y4 = y2
    print(x4, y4)


main()

